class Solution(object):
    def possibleBipartition(self, N, dislikes):
        """
        :type N: int
        :type dislikes: List[List[int]]
        :rtype: bool
        """

        def dfs(lis, dic, color):
            while( len(lis)!= 0 ):
                node = lis[0]
                if node in dic:
                    for i in dic[node]:
                        if color[i] == -1:
                            lis.append(i)
                            color[i] = 1 if color[node] == 0 else 0
                        else:
                            if color[i] == color[node]:
                                return False
                lis = lis[1:]
            return True

        mat = [[0] * N for i in range(N)]
        dic = dict()
        for d in dislikes:
            if d[0] - 1 not in dic:
                dic[d[0] - 1] = [d[1] - 1]
            else:
                dic[d[0] - 1].append(d[1] - 1)
            if d[1] - 1 not in dic:
                dic[d[1] - 1] = [d[0] - 1]
            else:
                dic[d[1] - 1].append(d[0] - 1)

        #print(mat)
        color = [-1] * N;
        color[0] = 0; lis = [0];
        return dfs(lis, dic, color)


